import NavBar from "./components/navbar/Navbar";
import Register from "./components/pages/register/Register"

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  BrowserRouter
} from "react-router-dom";

function App() {
  return (
    <div className="App">
      <NavBar />
      <Route path="/">
        <Register />
      </Route>
      <BrowserRouter>
      </BrowserRouter>
    </div>
  );
}

export default App;
